import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Profile = () => {
    return (
        <>
            <Head>
                <title>내 프로필 | NodeBird</title>
            </Head>
            <AppLayout>
                <NicknameEditForm/>
                <FollowingList header="팔로잉 목록"/>
                <FollowerList header="팔로워 목록"/>
                내 프로필
            </AppLayout>
        </>
    );
};

export default Profile;
